import styled from 'styled-components';

export const Container = styled.div`
  border: 0;
`;

export const Logo = styled.div`
  display: 'flex';
  justify-content: 'center';
  align-items: 'center';
  height: '63px';
  flex-shrink: 0;
  background: '#434c5b';

  img {
    cursor: 'pointer';
    height: '64px';
    padding: 15;
  }
`;
